import React from 'react'
import { Progress } from '../../Left/LeftBody/ProgresBar/CircualProgres'

function PerOvalSkills() {
    return (
        <div className="ml-4">
            <h4 className="mt-2 per_info_title fs-24">perofessional skills</h4>
            <Progress width={50} strokeWidth={5} percentage={50} key={10} />
            
        </div>
    )
}

export default PerOvalSkills
